// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.7.4;

import "@openzeppelin/contracts/token/ERC1155/ERC1155.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/utils/Strings.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Strings.sol";

contract Note is ERC1155, Ownable {

    constructor() ERC1155("https://notenft.com/api/metadata/") {}

    string private baseURI = "https://notenft.com/api/metadata/";

    using Counters for Counters.Counter;
    Counters.Counter private _tokenIds;

    event Mint(uint id);

    function mint(uint amout) public {


        _tokenIds.increment();
        uint256 newTokenId = _tokenIds.current();

        _mint(msg.sender, newTokenId, amout, "");

        emit Mint(newTokenId);
    }

    function uri(uint id) external view virtual override returns (string memory) {

        return string(abi.encodePacked(baseURI, Strings.toString(id)));
    }

}
